package de.stsFanGruppe.templatebuilder.external.xmlhelper;

public class EndOfXMLException extends Exception
{
	public EndOfXMLException()
	{
		super();
	}
	public EndOfXMLException(String message)
	{
		super(message);
	}
	public EndOfXMLException(Throwable cause)
	{
		super(cause);
	}
	public EndOfXMLException(String message, Throwable cause)
	{
		super(message, cause);
	}
}
